import React from 'react'

import { Link } from "react-router-dom";
import { Stack } from "@mui/material";

const Navbar = () => {
  return (
   <Stack direction="row" spacing={2} sx={{ justifyContent: "space-between" }}>

    <Link to="/">
        <img src/>
    </Link>

   </Stack>
  )
}

export default Navbar
